import React, { Component } from "react";
import { Link } from "react-router-dom";

export class NotFound extends Component {
  render() {
    return (
      <div>
        <h1>404!</h1>
        <p>No existe esta pagina</p>
        <Link to="/">
          <button>Regresas al inicio</button>
        </Link>
      </div>
    );
  }
}
